//маршрути
import Main from "./pages/main";
import Examination from "./pages/examination";
import Practice from "./pages/practice";
import Test from "./pages/test";

export const routes = [
     {
         //path: '/examination'+'/:id
         path: '/main', //шлях до сторінки
         Component: Main //сторінка
     },
     {
         path: '/examination',
         Component: Examination
     },
     {
         path: '/practice',
         Component: Practice
     },
     {
         path: '/test',
         Component: Test
     },
     //можливо мені нада буде більше сторінок
     //{
        //path: '/examination'+'/:id
        //Comment: Examination
    //}
 ]
